import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Heading from './heading';
import body from './body';


ReactDOM.render(
  <React.StrictMode>
      <Heading/>
      <Body></Body>
      <p>Hobbies</p>      
      <ul>
        <li>Cricket</li>
        <li>Games</li>
        <li>Coding</li>
      </ul>    
  </React.StrictMode>,
  document.getElementById('root')
);
